"""### Trend Analysis
![image.png](data:image/png;base64,)
"""

def trend(x):
  if x > -0.5 and x <= 0.5:
    return "Slight or No change"
  elif x > 0.5 and x <= 1:
    return "Slight Positive"
  elif x > -1 and x <= -0.5:
    return "Slight Negative"
  elif x > 1 and x <= 3:
    return "Positive"
  elif x > -3 and x <= -1:
    return "Negative"
  elif x > 3 and x <= 7:
    return "Among top gainers"
  elif x > -7 and x <= -3:
    return "Among top losers"
  elif x > 7:
    return "Bull run"
  elif x <= -7:
    return "Bear drop"

df["Trend"]= np.zeros(df["DailyChangePercent"].count())
df["Trend"]= df["DailyChangePercent"].apply(lambda x:trend(x))
df.head()

pie = df.sort_values("direction")
labels = sorted([i for i in df.loc[:, 'direction'].unique()])
plt.pie(pie['Trend'].count(), labels = labels, autopct = '%1.1f%%', radius = 2)
plt.show()

