"""SMOTE"""

import pandas as pd
from imblearn.over_sampling import SMOTE
from sklearn.model_selection import train_test_split
from sklearn.linear_model import LogisticRegression

# Convert date column to datetime format
df['Date'] = pd.to_datetime(df['Date'])

# Define the features and target variable
X = df[['AAPL.Open', 'AAPL.High', 'AAPL.Low', 'AAPL.Close', 'AAPL.Adjusted', 'AAPL.Volume']]
y = df['direction']

# Split the dataset into training and testing sets
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.3, random_state=42)

# Perform SMOTE analysis on the training set
smote = SMOTE(random_state=42)
X_train_smote, y_train_smote = smote.fit_resample(X_train, y_train)

# Train a logistic regression model on the original and SMOTE data
lr_orig = LogisticRegression(random_state=42).fit(X_train, y_train)
lr_smote = LogisticRegression(random_state=42).fit(X_train_smote, y_train_smote)

# Print the classification report for both models
from sklearn.metrics import classification_report

print('Classification report for original data:')
print(classification_report(y_test, lr_orig.predict(X_test)))

print('Classification report for SMOTE data:')
print(classification_report(y_test, lr_smote.predict(X_test)))


import matplotlib.pyplot as plt

fig, ax = plt.subplots(1, 2, figsize=(10, 5))
ax[0].hist(y_train)
ax[0].set_title('Before SMOTE')
ax[1].hist(y_train_smote)
ax[1].set_title('After SMOTE')
plt.show()

