# Distance based outlier detection

import pandas as pd
from sklearn.neighbors import LocalOutlierFactor

# Create a new dataframe with only the 'Close' column
closing_prices = df[['AAPL.Close']]

# Initialize the LOF algorithm
lof = LocalOutlierFactor(n_neighbors=20, contamination=0.1)

# Fit the LOF algorithm to the closing prices data
y_pred = lof.fit_predict(closing_prices)

# Create a new dataframe with the predicted outlier labels
outliers = pd.DataFrame(y_pred, columns=['Outlier'])

# Concatenate the original dataframe and the outliers dataframe
df_outliers = pd.concat([df, outliers], axis=1)

# Filter the dataset to only show the outliers
df_outliers = df_outliers[df_outliers['Outlier'] == -1]

# Print the outliers
print(df_outliers)

