# Experiment 08"""

df["Date"] = pd.to_datetime(df["Date"])

# Group the dataset by Date and calculate the mean of closed price
df = df.groupby("Date")["AAPL.Close"].mean().reset_index()

# Set the index of the dataframe as the Date column
df = df.set_index("Date")

# Split the dataset into training and testing sets
train_df = df.iloc[:len(df)-24] # Train data is first 24 months
test_df = df.iloc[len(df)-24:] # Test data is last 24 months

# Fit the ARIMA model on training data
from statsmodels.tsa.arima.model import ARIMA
model = ARIMA(train_df, order=(1,1,1))
model_fit = model.fit()

train = df.iloc[:-24]
test = df.iloc[-24:]
# Reset index of test data and remove original index
test = test.reset_index(drop=True)

# Forecast for the next 24 months using the index attribute of the reset DataFrame
forecast = model_fit.forecast(steps=24, index=test.index)[-24:]

f = plt.figure()
f.set_figwidth(9)
f.set_figheight(3)
plt.plot(train_df.index, train_df.values, label="Train Data")
plt.plot(test_df.index, test_df.values, label="Test Data")
plt.plot(test_df.index, forecast, label="Forecasted Data")
plt.legend()
plt.show()

